import React, { Component } from "react";
import Container from "react-bootstrap/Container";
import Card from "react-bootstrap/Card";

class Cost extends Component {
  state = {};
  render() {
    return (
      <div>
        <Container
          style={{
            alignitems: "center",
            textAlign: "center",
            fontWeight: "bold",
            color: "blue",
          }}
        >
          {" "}
          <h1> Hi </h1>
        </Container>
      </div>
    );
  }
}

export default Cost;
